import sys

#Input: Two strings of equal length.
#Output: The Hamming distance between these strings.

seq1 = ""

seq2 = ""

def hamming_distance(seq1,seq2):
	distance = 0
	length = len(seq1)
	for i in range(length):
		if seq1[i] != seq2[i]:
			distance += 1
	return distance

print(hamming_distance(seq1,seq2))